import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function CrearTorneo({ onAuthentication }) {
  const navigate = useNavigate();

  const [nombre, setNombre] = useState('');
  const [fecha_inicio, setInicio] = useState('');
  const [fecha_fin, setFin] = useState('');
  const [reglas, setReglas] = useState('');
  const [consola, setConsola] = useState('');
  const [num_participantes, setParticipantes] = useState('');
  const [juego, setJuego] = useState('');
  const [status, setStatus] = useState('');

  const [message, setMessage] = useState('');

  const handleCrearTorneo = async () => {
    try {
      const response = await fetch('http://localhost:5000/torneo/registrar', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ nombre, fecha_inicio, fecha_fin, reglas, consola, num_participantes, juego, status }),
      });

      if (response.ok) {
        const data = await response.json();
        if (data.success) {
            setMessage("Torneo registrado exitosamente");
        } else {
          setMessage(data.message);
        }
      } 
    else{
        setMessage("Error al registrar, el usuario ya existe")
    }
    } catch (error) {setMessage('Error en la solicitud');}
  };

  const isFormValid = nombre.trim() !== '' && status.trim() !== '' && fecha_inicio.trim() !== '' && fecha_fin.trim() !== '' && reglas.trim() !== '' && consola.trim() !== '' && num_participantes.trim() !== '' && juego.trim() !== '';

  return (
    <div className="contenedor">
      <h1>Crear Torneo</h1>
      <div>
        <input
          type="text"
          placeholder="Nombre del torneo"
          name="nombre"
          value={nombre}
          onChange={(e) => setNombre(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Estatus"
          name="status"
          value={status}
          onChange={(e) => setStatus(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Consola"
          name="consola"
          value={consola}
          onChange={(e) => setConsola(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Fecha de inicio"
          name="fecha_inicio"
          value={fecha_inicio}
          onChange={(e) => setInicio(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Número de participantes"
          name="num_participantes"
          value={num_participantes}
          onChange={(e) => setParticipantes(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Fecha de término"
          name="fecha_fin"
          value={fecha_fin}
          onChange={(e) => setFin(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Juego"
          name="juego"
          value={juego}
          onChange={(e) => setJuego(e.target.value)}
          required
        />
      </div>
      <div>
        <input
          type="text"
          placeholder="Reglas"
          name="reglas"
          value={reglas}
          onChange={(e) => setReglas(e.target.value)}
          required
        />
      </div>
      <div>
        <p></p>
        <button type="submit" onClick={handleCrearTorneo} disabled={!isFormValid}>
          Crear Torneo
        </button>
        <p>{message}</p>
      </div>
    </div>
  );
}

export default CrearTorneo;
